import React, { Component, Fragment, useState } from 'react';
import {render} from 'react-dom'

function configForm() {
    return <form>
        <div className='form-composant'>
            <label htmlFor="email">E-mail</label>
            <input type="text" id='email' name="nom" onChange={handleChange} placeholder='Nom'/>
        </div>
        <div className='form-composant'>
            <label htmlFor="nom">Nom</label>
            <input type="text" id='nom' name="nom" onChange={handleChange} placeholder='Nom'/>
        </div>
    </form>
    
}
export function Form() {
    const [value, setValue] = useState('Sergio')
    const handleChange = (e)=>{
        setValue(e.target.value)
        console.log(e.target.value);
    }
    return <Fragment>
        <configForm handleChange ={handleChange}/>
    </Fragment>
}
